script: |
  super -f text -I q10733.spq | sort > q10733.out

inputs:
  - name: q10733.spq
    data: |
      SELECT col2 / + col0 FROM tab0 (FORMAT parquet) WHERE ( + col0 + + col0 + + 58 / 52 + - - col0 * + - 23 / - col2 - - 51 ) NOT IN ( col1 * 53 );
  - name: tab0

outputs:
  - name: q10733.out
    data: |
      0
      1
      3
